import React from "react";
import "./Home.css";
import App from './src/App';

export default function Home()
{
    return(
        <div className="Home">
            <div className="Lander">
                <h1>Welocme to the App</h1>
                <p>A simple note making App</p>
            </div>
            <App />
        </div>
    );
}
